import React from "react";
import {
  Footer,
  Blog,
  Possibility,
  Features,
  WhatGPT3,
  Header,
} from "./Container";
import { Cta, Brand, Navbar } from "./Components";
import "./App.css";
import homebb from "./assets/homebb.png";

function App() {
  return (
    <div className="App">
      <div className="first_header">
        <div className="home_background">
          <img className="bb" src={homebb} alt="homebb" />
        </div>
        <Navbar />
        <Header />
      </div>
      <Brand />
      <WhatGPT3 />
      <Features />
      <Possibility />
      <Cta />
      <Blog />
      <Footer />
    </div>
  );
}

export default App;
